import React from 'react';
import './App.css';
import allProjects from './portfolio.json';
import Projects from './components/Projects'


class App extends React.Component() {
  constructor(props) {
    super(props);
    this.state = { projects: allProjects, projectsToDisplay: [] };
  }

  componentDidMount() {
    this.setState({ projectsToDisplay: allProjects });
  }

  renderProjects = () => {
    return this.state.projectsToDisplay.map((shoe, index) => {
      const { Brand, Type, Color, Size, Width, Price, imgURL } = shoe;
      return (
        <MensShoeCard
          key={index}
          price={Price}
          brand={Brand}
          type={Type}
          color={Color}
          size={Size}
          Width={Width}
          imgURL={imgURL}
        ></MensShoeCard>
      );
    });
  };








  render() {
    return (
      <div className="App">
        <allProjects></allProjects>
      </div>
    );
  }
}

export default App;
